uint32_t Index;
const uint8_t *ptr;
uint32_t counter;
uint8_t loop;
uint32_t indexBak;
void Sound_Init(uint32_t reload){
	Index = 0;
	DAC_Init();
	NVIC_ST_CTRL_R = 0;	//disable SysTick
	NVIC_ST_RELOAD_R = reload; //7256;		//11.025kHz
	NVIC_ST_CURRENT_R = 0;	//clear current register
	NVIC_SYS_PRI3_R = (NVIC_SYS_PRI3_R&0x00FFFFFF)|0x4000000;	//priority level 2
	NVIC_ST_CTRL_R = 0x00000007;
	
	volatile uint32_t delay;
	SYSCTL_RCGCGPIO_R |= 0x20;
	delay = SYSCTL_RCGCGPIO_R;
  GPIO_PORTF_AMSEL_R = 0x00;        
  GPIO_PORTF_PCTL_R = 0x00000000;  
  GPIO_PORTF_DIR_R |= 0x0A;			//PF3 and PF1 are outputs(heartbeats)
	GPIO_PORTF_DIR_R &= ~0x11;		//make PF4 and PF0 inputs
  GPIO_PORTF_AFSEL_R &= 0x1B;     
  GPIO_PORTF_DEN_R |= 0x1B; 
	//EnableInterrupts();
}


void Sound_Play(const uint8_t *pt, uint32_t count){
	ptr = pt;
	counter = count;
};
void Sound_Open(void){
	Index = 0;
	loop = 0;
	//Sound_Play(op1, 59511);
};
void Sound_Battle1(void){
	Index = 0;
	loop = 1;
	//Sound_Play(battle1, 197734);
	//Sound_Play(main1, 105334);
	Sound_Play(road1, 42053);
};
void Sound_Select(void){
	Index = 0;
	loop = 0;
	Sound_Play(select, 2433);
};

void Sound_Stop(void){
	indexBak = Index;
	Sound_Play(nothing, 1);
};

void Sound_Resume(void){
	Index = indexBak;
};

void Sound_Win(void){
	Index = 0;
	loop = 0;
	Sound_Play(win, 17693);
};
void Sound_Lose(void){
	Index = 0;
	loop = 0;
	Sound_Play(lose, 13241);
};
void Sound_Obtain(void){
	Index = 0;
	loop = 0;
	Sound_Play(obtain, 4250);
};
void Sound_Thunder(void){
	Index = 0;
	loop = 0;
	//Sound_Play(thunder, 5117);
};
void Sound_Hit(void){
	Index = 0;
	loop = 0;
	//Sound_Play(normaldamage, 4418);
};


void SysTick_Handler(void){
	GPIO_PORTF_DATA_R ^= 0x02;
	if(Index < counter){
		if(loop == 0)
			Index = ((Index + 1));
		else
			Index = ((Index + 1)%counter);
		GPIO_PORTF_DATA_R ^= 0x02;
	}
	DAC_Out(ptr[Index]);
	//GPIO_PORTF_DATA_R ^= 0x02;
}
